import Image from "react-bootstrap/Image";

const Projects = () => {
  const link = "https://images.pexels.com/photos/956981/milky-way-starry-sky-night-sky-star-956981.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500";
  return (
    <div>
      <Image src={`${link}`} style={{"background-size" : "cover"}} fluid/>
    </div>
  );
}

export default Projects;
